description:
Freund*innen der elektronischen Musik dürfen sich freuen: Das Kapitel Bollwerk ruft für alle Homestayers, Hausarrestierte, Stubenhockerinnen und anderweitig Corona-Betroffene die "CORONA-QUARANTÄNE-PODCAST"-Reihe ins Leben. Nach einem ambitionierten Pace von einem Mix pro Tag, haben wir das Tempo etwas runtergeschraubt, doch servieren nach wie vor in unregelmässigen Abständen tolle Mixes von Freund*innen des Hauses.

#64 kommt aus Genf beziehungsweise aus den Niederlanden & Agypten. Der in Genf sesshaft gewordene Hendrik van Boetzelaer, Kurator von OPUS und schimmernder Stern am Technohimmel - ehemals unter dem Alias Opuswerk - schickt uns deepen Sound via Netz in deine Stube. Enjoy!

