It's been almost two years since the last "official" Deeprhythms mix, a lot of good things have happened during the past months, massive so to everyone who has been involved.

New, unreleased, old and soon-to-be-reissued electronic music.

60 mins of this one aired on Lost Lounge Radio on wed, here's the whole set in full.

Also ->  http://www.deeprhythms.com/mixes/54_tropical_canopy.php

The Loon sample mix! Well, it almost is. Got an idea to base a mix around the infamous sample. but ran out of tracks and wanted to avoid the obvious ones. Instead, went with a tropical, dreamy mood that the first few selections set. A few oldies. a couple of reissues and a handful of very recent releases filled with lush pads and superb bouncy basslines - feels like 90's! T

